import React from "react";
import styled from "styled-components";

const Div = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Index = () => {
  return (
    <Div>
      <p>hi</p>
    </Div>
  );
};

export default Index;
